// src/components/CommunityNavigation.js
import React from 'react';
import { Link } from 'react-router-dom';
import './CommunityNavigation.css';

const CommunityNavigation = () => {
  return (
    <div className="community-navigation">
      <h3>고민 게시판</h3>
      <ul>
        <li><Link to="/community/gomin/10">10대 고민</Link></li>
        <li><Link to="/community/gomin/20">20대 고민</Link></li>
        <li><Link to="/community/gomin/30">30대 고민</Link></li>
        <li><Link to="/community/gomin/40">40대 고민</Link></li>
        <li><Link to="/community/gomin/gomsin">곰신 고민</Link></li>
        <li><Link to="/community/gomin/CC">CC 고민</Link></li>
      </ul>
    </div>
  );
};

export default CommunityNavigation;
